from typing import List

class Solution:

    def jump_my(self, nums: List[int]) -> int:
        n = len(nums)
        short_step = [0 for _ in range(n)]
        for i in range(1, n):
            min_step = None
            for j in range(0, i):
                steps = i - j
                if steps <= nums[j]:
                    _min_step = short_step[j] + 1
                    if min_step is None:
                        min_step = _min_step
                    else:
                        min_step = min(min_step, _min_step)
                else:
                    continue
            else:
                short_step[i] = min_step

        return short_step[-1]


    def jump(self, nums: List[int]) -> int:
        n = len(nums)
        maxPos, end, step = 0, 0, 0
        for i in range(n - 1):
            # if maxPos >= i:
            maxPos = max(maxPos, i + nums[i])
            if i == end:
                end = maxPos
                step += 1
        return step


